import { name } from "ejs";
import React from "react";


const AddProduct=()=>{
    return(
        <div className="product">
            <input type="text" className="inputBox" placeholder="Name" value={name}  / >
            <input type="text" className="inputBox" placeholder="Enter Product price"  / >
            <input type="text" className="inputBox" placeholder="Enter Product category"  / >
            <input type="text" className="inputBox" placeholder="Enter Product campany"  / >

        </div>
    )
}

export default AddProduct;
